import React, { useState, useEffect, useContext } from 'react';
import {
    Header, Icon, Form, Image, Message,
    Segment, Grid, Modal, Search, Button, Dimmer, Loader, Input, Container, List, Label, Divider, Item, Dropdown, Select, Checkbox
} from 'semantic-ui-react';

import { useForm } from "react-hook-form";
import Timekeeper from 'react-timekeeper';
import { DateInput, TimeInput, DateTimeInput, DatesRangeInput } from 'semantic-ui-calendar-react';

const Registration_Fifth = ({ formData, setForm, navigation, step }) => {

    const {
        COUNSELLOR_AVAILABILITY,
        COUNSELLOR_TIME_ZONE_CODE,
        COUNSELLOR_AVAILABILITY_DATE,

        COUNSELLOR_AVAILABILITY_MONDAY,
        COUNSELLOR_AVAILABILITY_TIME_MONDAY_FROM,
        COUNSELLOR_AVAILABILITY_TIME_MONDAY_TO,

        COUNSELLOR_AVAILABILITY_TUESDAY,
        COUNSELLOR_AVAILABILITY_TIME_TUESDAY_FROM,
        COUNSELLOR_AVAILABILITY_TIME_TUESDAY_TO,

        COUNSELLOR_AVAILABILITY_WEDNESDAY,
        COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_FROM,
        COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_TO,

        COUNSELLOR_AVAILABILITY_THURSDAY,
        COUNSELLOR_AVAILABILITY_TIME_THURSDAY_FROM,
        COUNSELLOR_AVAILABILITY_TIME_THURSDAY_TO,

        COUNSELLOR_AVAILABILITY_FRIDAY,
        COUNSELLOR_AVAILABILITY_TIME_FRIDAY_FROM,
        COUNSELLOR_AVAILABILITY_TIME_FRIDAY_TO,

        COUNSELLOR_AVAILABILITY_SATURDAY,
        COUNSELLOR_AVAILABILITY_TIME_SATURDAY_FROM,
        COUNSELLOR_AVAILABILITY_TIME_SATURDAY_TO

    } = formData;

    const [timings, setTimings] = useState('')

    const [mondayFrom, setMondayFrom] = useState({ time: '' });
    const [mondayTo, setMondayTo] = useState({ time: '' });
    const [tuesdayFrom, setTuesdayFrom] = useState({ time: '' });
    const [tuesdayTo, setTuesdayTo] = useState({ time: '' });
    const [wednesdayFrom, setWednesdayFrom] = useState({ time: '' });
    const [wednesdayTo, setWednesdayTo] = useState({ time: '' });
    const [thursdayFrom, setThursdayFrom] = useState({ time: '' });
    const [thursdayTo, setThursdayTo] = useState({ time: '' });
    const [fridayFrom, setFridayFrom] = useState({ time: '' });
    const [fridayTo, setFridayTo] = useState({ time: '' });
    const [satFrom, setSatFrom] = useState({ time: '' });
    const [satTo, setSatTo] = useState({ time: '' });
    const [icon_name, setIcon_name] = useState('circle');

    //new approach
    const [monday, setMonday] = useState([{ FROM: "", TO: "" }]);
    const [tuesday, setTuesday] = useState([{ FROM: "", TO: "" }]);
    const [wednesday, setWedday] = useState([{ FROM: "", TO: "" }]);
    const [thursday, setThursday] = useState([{ FROM: "", TO: "" }]);
    const [friday, setFriday] = useState([{ FROM: "", TO: "" }]);
    const [saturday, setSaturday] = useState({ Sat: Timings });


    const [days, setDays] = useState({
        monday: [{ FROM: "", TO: "" }],
        tuesday: [{ FROM: "", TO: "" }],
        wednesday: [{ FROM: "", TO: "" }],
        thursday: [{ FROM: "", TO: "" }],
        friday: [{ FROM: "", TO: "" }],
        saturday: [{ FROM: "", TO: "" }],
        sunday: [{ FROM: "", TO: "" }],
    });





    const [time, setTime] = useState([
        { Id: '00:30', value: '00:30' }, { Id: '01:00', value: '01:00' }, { Id: '01:30', value: '01:30' }, { Id: '02:00', value: '02:00' }, { Id: '02:30', value: '02:30' }, { Id: '03:00', value: '03:00' }, { Id: '03:30', value: '03:30' }, { Id: '04:00', value: '04:00' }, { Id: '04:30', value: '04:30' }, { Id: '05:00', value: '05:00' },
        { Id: '05:30', value: '05:30' }, { Id: '06:00', value: '06:00' }, { Id: '06:30', value: '06:30' }, { Id: '07:00', value: '07:00' }, { Id: '07:30', value: '07:30' }, { Id: '08:00', value: '08:00' }, { Id: '08:30', value: '08:30' }, { Id: '09:00', value: '09:00' }, { Id: '09:30', value: '09:30' }, { Id: '10:00', value: '10:00' },
        { Id: '10:30', value: '10:30' }, { Id: '11:00', value: '11:00' }, { Id: '11:30', value: '11:30' }, { Id: '12:00', value: '12:00' }, { Id: '12:30', value: '12:30' }, { Id: '13:00', value: '13:00' }, { Id: '13:30', value: '13:30' }, { Id: '14:00', value: '14:00' }, { Id: '14:30', value: '14:30' }, { Id: '15:00', value: '15:00' },
        { Id: '15:30', value: '15:30' }, { Id: '16:00', value: '16:00' }, { Id: '16:30', value: '16:30' }, { Id: '17:00', value: '17:00' }, { Id: '17:30', value: '17:30' }, { Id: '18:00', value: '18:00' }, { Id: '18:30', value: '18:30' }, { Id: '19:00', value: '19:00' }, { Id: '19:30', value: '19:30' }, { Id: '20:00', value: '20:00' },
        { Id: '20:30', value: '20:30' }, { Id: '21:00', value: '21:00' }, { Id: '21:30', value: '21:30' }, { Id: '22:00', value: '22:00' }, { Id: '22:30', value: '22:30' }, { Id: '23:00', value: '23:00' }, { Id: '23:30', value: '23:30' }, { Id: '24:00', value: '24:00' }
    ]);

    let timeList = time.length > 0 && time.map((item, i) => {
        return (
            <>
                <option key={item.Id} value={item.id}>{item.value}</option>
            </>
        )
    }, this);

    useEffect(() => {
        if (COUNSELLOR_AVAILABILITY_MONDAY.length > 0)
            setDays((days) => ({
                ...days,
                monday: COUNSELLOR_AVAILABILITY_MONDAY
            }));

        if (COUNSELLOR_AVAILABILITY_TUESDAY.length > 0)
            setDays((days) => ({
                ...days,
                tuesday: COUNSELLOR_AVAILABILITY_TUESDAY
            }));

        if (COUNSELLOR_AVAILABILITY_WEDNESDAY.length > 0)
            setDays((days) => ({
                ...days,
                wednesday: COUNSELLOR_AVAILABILITY_WEDNESDAY
            }));

        if (COUNSELLOR_AVAILABILITY_THURSDAY.length > 0)
            setDays((days) => ({
                ...days,
                thursday: COUNSELLOR_AVAILABILITY_THURSDAY
            }));

        if (COUNSELLOR_AVAILABILITY_FRIDAY.length > 0)
            setDays((days) => ({
                ...days,
                friday: COUNSELLOR_AVAILABILITY_FRIDAY
            }));

        if (COUNSELLOR_AVAILABILITY_SATURDAY.length > 0)
            setDays((days) => ({
                ...days,
                saturday: COUNSELLOR_AVAILABILITY_SATURDAY
            }));

        // etc for each day of the week
    }, []);


    const onSubmit = (data) => {
        const e = {
            target: {
                name: "COUNSELLOR_AVAILABILITY_MONDAY",
                value: days.monday
            }
        };
        const f = {
            target: {
                name: "COUNSELLOR_AVAILABILITY_TUESDAY",
                value: days.tuesday
            }
        };

        const g = {
            target: {
                name: "COUNSELLOR_AVAILABILITY_WEDNESDAY",
                value: days.tuesday
            }
        };

        const h = {
            target: {
                name: "COUNSELLOR_AVAILABILITY_THURSDAY",
                value: days.tuesday
            }
        };

        const i = {
            target: {
                name: "COUNSELLOR_AVAILABILITY_FRIDAY",
                value: days.tuesday
            }
        };

        const j = {
            target: {
                name: "COUNSELLOR_AVAILABILITY_SATURDAY",
                value: days.tuesday
            }
        };

        setForm(e);
        setForm(f);
        setForm(g);
        setForm(h);
        setForm(i);
        setForm(j);

        navigation.next();
    };

    // handle input change
    const handleInputChangeForDay = (e, day, index) => {
        const { name, value } = e.target;
        const list = [...days[day]];
        list[index][name] = value;

        setDays((days) => ({
            ...days,
            [day]: list
        }));
    };

    // handle click event of the Remove button
    const handleRemoveClickForDay = (day, index) => {
        const list = [...days[day]];
        list.splice(index, 1);

        setDays((days) => ({
            ...days,
            [day]: list
        }));
    };

    // handle click event of the Add button
    const handleAddClickForDay = (day) => () => {

        setDays((days) => ({
            ...days,
            [day]: [...days[day], { FROM: "", TO: "" }]
        }));
    };


    const friendOptions = [
        {
            key: 'Jenny Hess',
            text: 'Jenny Hess',
            value: 'Jenny Hess',
            image: { avatar: true, src: '/images/avatar/small/jenny.jpg' },
        },
        {
            key: 'Elliot Fu',
            text: 'Elliot Fu',
            value: 'Elliot Fu',
            image: { avatar: true, src: '/images/avatar/small/elliot.jpg' },
        },
    ]

    const { handleSubmit, register, errors } = useForm({

    });

    useEffect(() => {
        if (step.id == 'Counsellor_availability')
            setIcon_name('circle')
        else
            setIcon_name('circle outline')
    }, [])


    const Counsellor_TimeZone = [
        {
            title: "Choose Institute",
            name: [
                "Adrenaline Addicts", "Culture Lovers", "Aquatic adventures", "Beach enthusiasts"
            ],
            code: [0, 1, 2, 3]
        }
    ]

    const onMondayFrom = (val) => {
        setMondayFrom({ ...mondayFrom, time: val.target.value })
    }

    const onMondayTo = (val) => {
        setMondayTo({ ...mondayTo, time: val.target.value })
    }


    const onTuesFrom = (val) => {
        setTuesdayFrom({ ...tuesdayFrom, time: val.target.value })
    }

    const onTueTo = (val) => {
        setTuesdayTo({ ...tuesdayTo, time: val.target.value })
    }

    const onWedFrom = (val) => {
        setWednesdayFrom({ ...wednesdayFrom, time: val.target.value })
    }

    const onWedTo = (val) => {
        setWednesdayTo({ ...wednesdayTo, time: val.target.value })
    }

    const onThuFrom = (val) => {
        setThursdayFrom({ ...thursdayFrom, time: val.target.value })
    }

    const onThuTo = (val) => {
        setThursdayTo({ ...thursdayTo, time: val.target.value })
    }

    const onFriFrom = (val) => {
        setFridayFrom({ ...fridayFrom, time: val.target.value })
    }

    const onFriTo = (val) => {
        setFridayTo({ ...fridayTo, time: val.target.value })
    }

    const onSatFrom = (val) => {
        setSatFrom({ ...satFrom, time: val.target.value })
    }

    const onSatTo = (val) => {
        setSatTo({ ...satTo, time: val.target.value })
    }




    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_MONDAY_FROM = mondayFrom.time;
    }, [mondayFrom])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_MONDAY_TO = mondayTo.time;
    }, [mondayTo])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_TUESDAY_FROM = tuesdayFrom.time;
    }, [tuesdayFrom])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_TUESDAY_TO = tuesdayTo.time;
    }, [tuesdayTo])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_FROM = wednesdayFrom.time;
    }, [wednesdayFrom])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_TO = wednesdayTo.time;
    }, [wednesdayTo])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_THURSDAY_FROM = thursdayFrom.time;
    }, [thursdayFrom])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_THURSDAY_TO = thursdayTo.time;
    }, [thursdayTo])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_FRIDAY_FROM = fridayFrom.time;
    }, [fridayFrom])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_FRIDAY_TO = fridayTo.time;
    }, [fridayTo])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_SATURDAY_FROM = satFrom.time;
    }, [satFrom])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_SATURDAY_TO = satTo.time;
    }, [satTo])


    useEffect(() => {

        if (COUNSELLOR_AVAILABILITY_TIME_MONDAY_FROM)
            setMondayFrom({ time: COUNSELLOR_AVAILABILITY_TIME_MONDAY_FROM })

        if (COUNSELLOR_AVAILABILITY_TIME_MONDAY_TO)
            setMondayTo({ time: COUNSELLOR_AVAILABILITY_TIME_MONDAY_TO })

